    let dispatch = useDispatch()

    let countries = useSelector((state) => state.countries)

    useEffect(() => {
        dispatch(getAllCountries())
    },[])

    return(
        <div>
            <h1>COUNTRIES:</h1>
        </div>
    )
}

export default Home;
